import { Grid } from '@mui/material';
import React,{useState,useEffect, useRef} from 'react';
import {HomeWrapper} from './styled'
import Paper from '@mui/material/Paper';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import dayjs from 'dayjs'
import TableRow from '@mui/material/TableRow';


const columns = [
    { id: 'name', label: 'Name', minWidth: 170 },
    { id: 'date', label: 'Date', minWidth: 100 },

  ];


const Archive:React.FC = () =>{
    const [data,setData] = useState<any[]>([])

    const getList  = async()=>{
        const response = await fetch('http://localhost:3800/all-meeting', {
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
                'Access-Control-Allow-Origin':'*'
            },

        });
        let resp = await response.json()
        setData(resp)
    }

    useEffect( ()=>{
        getList()
    },[])

    function parseISOString(s:any) {
        var b = dayjs(s).format('[YYYYescape] YYYY-MM-DDTHH:mm:ssZ[Z]') ;
        // return new Date(Date.UTC(b[0], --b[1], b[2], b[3], b[4], b[5], b[6]));
        console.log(b,'==b ');
        return 1

      }


    return <HomeWrapper container spacing={2}>
        <Grid item md={12}>
        <Paper sx={{ width: '100%', overflow: 'hidden' }}>
            <TableContainer sx={{ maxHeight: 440 }}>
                <Table stickyHeader aria-label="sticky table">
                <TableHead>
                    <TableRow>
                    {columns.map((column) => (
                        <TableCell
                        key={column.id}
                        style={{ minWidth: column.minWidth }}
                        >
                        {column.label}
                        </TableCell>
                    ))}
                        <TableCell >
                        Action
                        </TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {
                        data.map((meeting:any,index:number)=>{
                            let date = parseISOString( meeting.date)
                            return  <TableRow hover role="checkbox" tabIndex={-1} key={index}>
                                <TableCell >
                                {   meeting.title}
                                </TableCell>
                                <TableCell >
                                    {date}
                                </TableCell>
                            </TableRow>
                        })
                    }
                    {/* {rows
                    .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                    .map((row) => {
                        return (
                        <TableRow hover role="checkbox" tabIndex={-1} key={row.code}>
                            {columns.map((column:any) => {
                            const value = row[column.id];
                            return (
                                <TableCell key={column.id} align={column.align}>
                                {column.format && typeof value === 'number'
                                    ? column.format(value)
                                    : value}
                                </TableCell>
                            );
                            })}
                        </TableRow>
                        );
                    })} */}
                </TableBody>
                </Table>
            </TableContainer>
            {/* <TablePagination
                rowsPerPageOptions={[10, 25, 100]}
                component="div"
                count={rows.length}
                rowsPerPage={rowsPerPage}
                page={page}
                onPageChange={handleChangePage}
                onRowsPerPageChange={handleChangeRowsPerPage}
            /> */}
        </Paper>
        </Grid>

    </HomeWrapper>
}

export default Archive
